import React from "react";
import red from "../images/red.jpg";

class Football extends React.Component {
  red() {
    alert("I am red!");
  }
  blue() {
    alert("I am blue!");
  }
  yellow() {
    alert("I am yellow!");
  }

  purple() {
    alert("I am purple!");
  }
  pink() {
    alert("I am pink!");
  }
  orange() {
    alert("I am orange!");
  }
  black() {
    alert("I am black!");
  }
  white() {
    alert("I am white!");
  }
  grey() {
    alert("I am grey!");
  }
  render() {
    return (
      <>
        <Image style={styles.container} source={require("./red.png")}>
          <Button title="play" style={{ color: "red" }} />
        </Image>
        <button style={{ color: "red" }} onClick={this.red}>
          Check I am red!
        </button>
        <button style={{ color: "blue" }} onClick={this.blue}>
          Check I am blue!
        </button>
        <button style={{ color: "yellow" }} onClick={this.yellow}>
          Check I am red!
        </button>
        <button style={{ color: "purple" }} onClick={this.purple}>
          Check I am blue!
        </button>
        <button style={{ color: "pink" }} onClick={this.pink}>
          Check I am red!
        </button>
        <button style={{ color: "orange" }} onClick={this.orange}>
          Check I am blue!
        </button>
        <button style={{ color: "black" }} onClick={this.black}>
          Check I am red!
        </button>
        <button style={{ color: "grey" }} onClick={this.grey}>
          Check I am blue!
        </button>
        <button style={{ color: "white" }} onClick={this.white}>
          Check I am blue!
        </button>
      </>
    );
  }
}
export default Football;
